# Stream的使用
Stream可以配合支持Stream的类实现自动更新或则监听功能。监听和触发监听都需要通过StreamController类来实现。

## StreamController类

StreamController提供了sink和stream属性。

sink通过add方法负责往流里面添加数据。stream通过listen方法添加监听回调。

```dart
  final voidController = StreamController<void>();
  final intController = StreamController<int>();
  final stringController = StreamController<String>();
  final boolController = StreamController<bool>();

  // 还可以监听其他类型

  voidController.sink.add(null);
  intController.sink.add(1);
  stringController.sink.add('aaa');
  boolControoler.sink.add(true);

```

