### 使用os.File.Readdir
ReadDir内部的实现方式
```go
// ReadDir reads the directory named by dirname and returns
// a list of directory entries sorted by filename.
func ReadDir(dirname string) ([]os.FileInfo, error) {
    f, err := os.Open(dirname)
    if err != nil {
        return nil, err
    }
    list, err := f.Readdir(-1)
    f.Close()
    if err != nil {
        return nil, err
    }
    sort.Slice(list, func(i, j int) bool { return list[i].Name() < list[j].Name() })
    return list, nil
}
```
我们可以看到它只扫描文件夹目录，然后将文件通过名字排序。如果我们不需要这种排序我们可以这样：

```go
package main

import (
    "fmt"
    "log"
    "os"
)

func main() {
    dirname := "."

    f, err := os.Open(dirname)
    if err != nil {
        log.Fatal(err)
    }
    files, err := f.Readdir(-1)
    f.Close()
    if err != nil {
        log.Fatal(err)
    }

    for _, file := range files {
        fmt.Println(file.Name())
    }
}
```
可以看到我们拆解了原方法的部分，dirname我们可以自己传，只使用Readdir(-1)这个方法去遍历文件夹。说实话这个-1我不是很懂为什么可以这么传，如果有会的大神能不能评论解释一下。


## go 文件夹下所有文件查找指定字符串

```go
package main

import (
	"bufio"
	"fmt"
	"os"
	"path/filepath"
	"strings"
)

func main() {

	root := "."
	filepath.Walk(root, walkfunc)
}

func walkfunc(path string, info os.FileInfo, err error) error {

	//过滤目录
	if info.IsDir() {
		return nil
	}
	// 打印文件名
	fmt.Println(filepath.Base(path))

	f, err := os.Open(path)
	if err != nil {
		return nil
	}
	defer f.Close()

	// 每行读取
	scanner := bufio.NewScanner(f)
	for scanner.Scan()  {
		// 抓取/api所在的行
		if strings.Contains(scanner.Text(), "/api") {
			fmt.Println(scanner.Text()), // 这里就可以当成字符串处理该行
		}
	}

	err = scanner.Err()
	fmt.Println(err)

	return nil
}
```


## json 解析
go生成和解析json结构是按结构体模式解析的，所以结构体类型一定要多练习熟悉。

## 多维json数组解析
完整代码（可以运行）:
```go
// +build ignore
package main

import (
	"encoding/json"
	"fmt"
)

type Person struct {
	Name string
	Age  int
}

type Family struct {
    Persons []Person
}

func main() {
	// 根据结构体生成json
	manJson := Person{
		Name: "Elinx",
		Age:  26,
	}
	man, _ := json.Marshal(manJson)
	fmt.Println(string(man))

	// 解析json到结构体
	jsonStr := []byte(`{"Name":"Elinx","Age":26}`)
	var man2 Person
	json.Unmarshal(jsonStr, &man2)
	fmt.Println(man2)

	// 解析json数组到切片（数组）
	jsonArrStr := []byte(`[{"Name":"Elinx","Age":26}, {"Name":"Twinkle","Age":21}]`)
	var jsonSlice []map[string]interface{}

	json.Unmarshal(jsonArrStr, &jsonSlice)
	fmt.Println(jsonSlice)

	// 解析多维数组
	var f Family

    // 模拟传输的Json数据
    familyJSON := `{"Persons": [{"Name":"Elinx","Age":26}, {"Name":"Twinkle","Age":21}] }`
	
	fmt.Println("======================")

    // 解析字符串为Json
	json.Unmarshal([]byte(familyJSON), &f)
	// 直接输出并不会展示全部层级，原因待考究
	fmt.Println(f)
	// 从新生成json字符串查看真实结构
	jsons, _ := json.Marshal(f)

	fmt.Println(string(jsons))
}
```
