# 对象
什么是对象，javascript里面{}就是一个对象。
所以下面函数输出的结果是一个`[Function: Object]`

```
console.log({}.constructor);
```
注意。
1. 任意一个方法(箭头方法除外)都有一个prototype对象。所以任意一个方法都是构造函数，都可以用来创建对象。
2. 不是所有具有prototype的javascript值都可以作为构造函数。只有用function,class关键字定义的函数才可以,class名用typeof打印其实就是function。
