## Object.prototype
对象的原型，每一个javascript对象都有原型!数字没有prototype也无法设置prototype!

### 通过修改原型实现继承
把一个类的原型指向父类的实例对象可以实现继承。
```
function Person(){
  this.name = 'zhang san';
  this.age = 45;
}

function Boy(){
  this.sex = 'boy';
}

//继承实现
Boy.prototype = new Person();

```

原型继承实现的缺点就是子类里面没有完整继承父类都属性，只是通过javascript的链式访问能够访问父类的对象属性而已。
父类的对象动态添加属性可以动态的所有子类对象添加可访问属性。
原型继承的特点：继承了父类的模版，同时继承了父类的原型对象。


## Object.prototype.constructor
上面介绍了什么样的只有function和class关键字创建的function才能作为对象的构造函数。

注意:每一个javascript对象都有构造函数！但是不一定有prototype对象。number对象的构造函数是[Fuction Number]

### 修改构造函数的原型实现继承

要实现继承只需要将子类指向以父类原型为原型的空对象。

>不能粗暴修改粗暴的把子类的原型指向父类的原型。这样他们两个就共享了原型，修改了子类的原型会影响到父类的原型。
其实这样的继承也是假继承Child会继承父类的name属性和值。

```javascript
function Parent() {
  this.name = "zhang san"
};
function Child() {

}
//修改原型继承
Child.prototype = Object.create(Parent.prototype);
//Child.prototype修改之后需要把原型的构造函数重新指向子类。
Child.prototype.constructor = Child; // set right constructor for further using

Child.prototype.create = function create() {
  return new this.constructor();
}

new Child().create().create(); // it's pretty fine
```
原型对象的继承方式Child并不能继承Parent的name属性，
如果我们需要完美继承父类的属性到自己身上需要在子类的构造函数里面绑定父类的构造函数。
如下面代码，这样就可以完美继承父类的属性。
```javascript
function Child(name) {
  Parent.call(this,name);
}
```

注意在修改完`Child.prototype`之后需要把修改后原型的构造函数重新指向`Child`否则`new Child().create().create();`会报错。不能保证构造函数被正确执行。

## Object.defineProperty() 
给一个对象添加属性!添加的属性可以设置是否被枚举对象属性的方法列出来。（for...in,Object.keys()）
作用：
* 确保对象一定拥有某属性。
* 定义类常量或者对象常量
* 定义不被枚举的属性
* 
## 语法
```
Object.defineProperty(obj,prop,descriptor)
```

`obj`:被添加属性的对象
`prop`:添加的属性名称或者Symbol
`descriptor`:属性描述符号是一个对象。

## 属性描述符可以拥有的键
### 一定有的属性
* confiurable:只有在true时候，该属性的描述符号才能够被改变，同时该属性也能从对于的对象上被删除。默认是false（这个功能很强大可以确保对象有某个属性）
* enumerable: 当且仅当属性的enumerable的值为true时候，该属性才会出现在对象的枚举属性中。对象.propertyIsEnumerable判断属性是否是true
```
o.propertyIsEnumerable('a'); // true
o.propertyIsEnumerable(Symbol.for('e')); // true

```

### 可选值
下面的数据描述和存取描述不能同时存在。意思是要么是value和writable组合，要么是set和get组合。

### 数据描述
* value:该属性对应的值。可以是任何javascript值（对象，数值，函数等）。默认undefined.
* writable:当且仅当该属性值为true时候，这个值可以被改变，也就是value可以被赋值运算改变。默认为false.

### 存取描述
* set:类似OC的set方法,可以设置时候做一些而外处理操作。
* get:类似OC的get方法，可以设置返回固定值

注意：存取描述符和数据描述符混合使用会抛出异常

`TypeError: value appears only in data descriptors, get appears only in accessor descriptors`

### 使用主意事项。
Object.defineProperty()给对象添加的是自身的属性，不会加到结构函数的prototype上。

### 对象点调用运算的实际底层
```
