## context的定义
```js
function (context) { // Could be asyncData, nuxtServerInit, ...
  // Always available
  const {
    app,   //拓展模块可以直接通过app来读取如：安装并配置了nuxtjs/http可以通过 context.app.$http.$get()
    store, //vuex 模块
    route, // 导航路由
    params, //直接读取http请求的参数。如http://xxx.xx？id=1233   conext.params.id
    query,
    env,
    isDev,
    isHMR,
    redirect, //重定向
    error, //可以用来展示nuxt的error页面。如context.error(e)
    $config
  } = context

  // Only available on the Server-side
  if (process.server) {
    const { req, res, beforeNuxtRender } = context
  }

  // Only available on the Client-side
  if (process.client) {
    const { from, nuxtState } = context
  }
}
```

