# vuex (store)
vuex的工作流程如下：
<MarkdownImage path="html/vue_1.png"></MarkdownImage>

如上图所示通过使用action,mutation来管理State。

action,mutation,state是无论什么组件都能够访问的。所以我们能应用的状态统一起来管理。
action是通过dispatch方法来执行。mutation是通过commit方法来执行。

## action特点
action是在执行commit之前做的一些操作，比如网络请求等。也可以做一些数据的加工。action只是单纯的方法。

## mutation特点
为了更新state的状态。只是单纯的更新state的状态。不要去执行其他逻辑。

## state
只是单纯的存储数据。一个个的存储数据。


## nuxt简单使用vuex


